/**
 * kaiu.ttf (DFKai-SB / ETen-B5-H) glyph index -> Unicode BMP codepoint lookup
 * Used to fix garbled text from Identity-H CID fonts without ToUnicode map
 * Auto-generated from Windows kaiu.ttf. Do not edit manually.
 */

const KAIU_B64 =
  "";

let _map: Uint16Array | null = null;

export function getKaiuMap(): Uint16Array {
  if (!_map) {
    const raw = atob(KAIU_B64);
    const buf = new Uint8Array(raw.length);
    for (let i = 0; i < raw.length; i++) buf[i] = raw.charCodeAt(i);
    _map = new Uint16Array(buf.buffer);
  }
  return _map;
}

/**
 * Detect if a string is garbled due to Identity-H CID passthrough.
 * Garbled chars appear in U+0100-U+1FFF (Cyrillic/Greek/Arabic etc.)
 * instead of U+4E00-U+9FFF (CJK Unified Ideographs).
 */
export function isCidPassthrough(str: string): boolean {
  if (!str || str.length < 2) return false;
  let inRange = 0;
  for (let i = 0; i < str.length; i++) {
    const cp = str.charCodeAt(i);
    if (cp >= 0x0100 && cp <= 0x1FFF) inRange++;
  }
  return inRange / str.length > 0.4;
}

/**
 * Decode a garbled CID-passthrough string using kaiu.ttf glyph mapping.
 * Each character's charCode is a glyph index; this maps it to Unicode.
 * Falls back to original character if glyph index has no mapping.
 */
export function decodeKaiuFont(str: string): string {
  const map = getKaiuMap();
  let result = "";
  for (let i = 0; i < str.length; i++) {
    const glyphIndex = str.charCodeAt(i);
    const cp = glyphIndex < map.length ? map[glyphIndex] : 0;
    result += cp ? String.fromCharCode(cp) : str[i];
  }
  return result;
}
